import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useHistory } from 'react-router-dom';
import './App.css';

const Step2 = () => {
  const history = useHistory();
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [vehicles, setVehicles] = useState([]);

  useEffect(() => {
    const fetchVehicles = async () => {
      try {
        // Get token from local storage
        const token = localStorage.getItem('token');

        // Make API call to get available vehicles
        const response = await axios.get(`https://calm-retreat-90846-cd036e8a822e.herokuapp.com/https://api.rentsyst.com/v2/booking/search`, {
          params: {
            pickupDateTime: 'YOUR_PICKUP_DATE_TIME', // Replace with actual pickup date time
            returnDateTime: 'YOUR_RETURN_DATE_TIME', // Replace with actual return date time
            selectedLocation: 'YOUR_SELECTED_LOCATION', // Replace with actual selected location
            customAddress: 'YOUR_CUSTOM_ADDRESS' // Replace with actual custom address
          },
          headers: {
            Authorization: `Bearer ${token}`, // Include token in Authorization header
          },
        });

        // Set vehicles state with response data
        setVehicles(response.data);
      } catch (error) {
        console.error('Error fetching vehicles:', error);
        setError('Failed to fetch vehicles');
      } finally {
        setLoading(false);
      }
    };

    // Call fetchVehicles function
    fetchVehicles();
  }, []);

  return (
    <div className="step2">
      <h2>Available Vehicles</h2>
      {loading && <p>Loading...</p>}
      {error && <p>{error}</p>}
      {!loading && !error && (
        <div className="vehicle-list">
          {vehicles.map(vehicle => (
            <div key={vehicle.id} className="vehicle-item">
              <h3>{vehicle.name}</h3>
              <p>{vehicle.description}</p>
              {/* Render other vehicle details */}
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default Step2;
